const words={
    fr: {
      accueil: 'Accueil',
      recherche:'Recherche',
      message: 'Message',
      profil : 'Profil',

    },
    ar:{
        accueil: 'مختارات',
        recherche:'بحث',
        message: 'الرسائل',
        profil : 'الملف',
    }
  };

export default function Language(lng){

    if(lng == undefined || words[lng] == undefined) return words.fr;

    return words[lng];
}
